def knight_min_health(m, n, start_row, start_col):
    dp = [[0 for i in range(n)] for j in range(m)]
    dp[start_row][start_col] = start_col + start_row

    for i in range(m):
        dp[i][start_col] = dp[i][start_col-1] + start_col + start_row

    for i in range(n):
        dp[start_row][i] = dp[start_row][i-1] + start_col + start_row

    for i in range(start_row+1, m):
        for j in range(start_col+1, n):
            dp[i][j] = max(dp[i-1][j], dp[i][j-1]) + abs(start_col - j)

    return dp[m-1][n-1]

