def isGood(a):
    n = len(a)
    m = len(a[0])
    even = []
    odd = []
    for i in range(n):
        for j in range(m):
            if a[i][j] == 1:
                if len(even) % 2 == 0:
                    even.append((i, j))
                else:
                    odd.append((i, j))
            else:
                if len(odd) % 2 == 0:
                    odd.append((i, j))
                else:
                    even.append((i, j))
    if len(even) % 2 != 0 or len(odd) % 2 != 0:
        return -1
    if len(even) == 0 or len(odd) == 0:
        return sum(sum(row) for row in a)
    if len(even) >= len(odd):
        even, odd = odd, even
    L, R = len(even), len(odd)
    dp = [[0 for _ in range(m + 1)] for _ in range(n + 1)]
    for i in range(1, n + 1):
        for j in range(1, m + 1):
            if a[i - 1][j - 1] == 1:
                dp[i][j] = dp[i - 1][j] + dp[i][j - 1] - dp[i - 1][j - 1] + 1
            else:
                dp[i][j] = dp[i - 1][j] + dp[i][j - 1] - dp[i - 1][j - 1]
            if i == 1 and j == 1:
                continue
            if i == 1:
                dp[i][j] += even[L - 1]
                dp[i][j] -= odd[R - 1]
            elif j == 1:
                dp[i][j] += odd[L - 1]
                dp[i][j] -= even[R - 1]
            else:
                dp[i][j] += even[L - 1]
                dp[i][j] -= odd[R - 1]
            if dp[i][j] >= m:
                return sum(sum(row) for row in a)
    for i in range(1, n + 1):
        for j in range(1, m + 1):
            dp[i][j] += dp[i - 1][j] + dp[i][j - 1] - dp[i - 1][j - 1]
    return dp[n][m]

