def min_operations(s, t):
    if len(s) != len(t):
        return -1

    s_count = {}
    t_count = {}

    for i in s:
        if i not in s_count:
            s_count[i] = 1
        else:
            s_count[i] += 1

    for i in t:
        if i not in t_count:
            t_count[i] = 1
        else:
            t_count[i] += 1

    operations = 0
    for i in set(list(s_count.keys()) + list(t_count.keys())):
        if i not in s_count or i not in t_count:
            continue
        operations += max(s_count[i], t_count[i]) - 1

